import React from 'react'
import 'bootstrap/dist/css/bootstrap.css'

export default function Main6() {
    const itemArr = ["Rice", "Wheat", "Dal", "Egg"];

    return (
        <div>
            <h1>List of Ingredients</h1>
            <ol>
                {itemArr.map((item) => (
                    <li key={item}>{item}</li>
                ))}
            </ol>
        </div>
    );
}
